import React, { useState } from "react"
import JSONDATA from "./Services.json"
import "./assests/style.css"


export default function SearchServices() {
  const [result, setResult] = useState("");
  return (
    <>
      <section>
        <div className="container-fluid bg-light hght">
          <div className="container">
            <h1
              style={{  
                color: "#3d403e",
                marginTop: "2px",
                marginBottom: "32px",
              }}
            >
              All Services
            </h1>
            
              <input
                className="form-control me-3 mb-4  service-input input-width"
                type="text"
                placeholder="Search"
                aria-label="Search"
                onChange={(event) => {
                  setResult(event.target.value);
                }}
              />
              <button className="btn btn-warning p-2 mb-4 btnn " type="submit">
                SEARCH
              </button>
            

            <div className="row">
              <div className="col-md-4">
                <b>CONSULT AN EXPERT</b>
                {JSONDATA.filter((val) => {
                  if (result == " ") {
                    return val
                  } else if (
                    val.consult.toLowerCase().includes(result.toLowerCase())
                  ) {
                    return val
                  }
                }).map((val, key) => {
                  return (
                    <li key={key}>
                      <a href="" className="itemstyle">
                        {val.consult}
                      </a>
                    </li>
                  );
                })}
              </div>

              <div className="col-md-4">
                <b>Tax</b>

                {JSONDATA.filter((val) => {
                  if (result == " ") {
                    return val;
                  } else if (
                    val.tax.toLowerCase().includes(result.toLowerCase())
                  ) {
                    return val;
                  }
                }).map((val, key) => {
                  return (
                    <li key={key}>
                      <a href="">{val.tax}</a>
                    </li>
                  );
                })}
              </div>

              <div className="col-md-4">
                <b>DOCUMENTATION</b>
                {JSONDATA.filter((val) => {
                  if (result == " ") {
                    return val;
                  } else if (
                    val.documentation
                      .toLowerCase()
                      .includes(result.toLowerCase())
                  ) {
                    return val;
                  }
                }).map((val, key) => {
                  return (
                    <li key={key}>
                      <a href="">{val.documentation}</a>
                    </li>
                  );
                })}
              </div>
            </div>
          </div>
        </div>
      </section>
      
    </>
  );
}
